import ".Card.css";

function Card() {
    return ( 
    <div className="main">
        <div className="card">
            
                <div className="card-detail">
                    <h2>Producto</h2>
                    <p>Producto En Venta</p>
                    <h3>$ 23400</h3>
                    <button>Ver Mas</button>
                </div>
            </div>
        </div>
    );
}

export default Card;
